import './App.css';
export function Message(props){
    return <h3 className={props.loginStatus == 1 ? 'success' : 'error'}>
    {
        props.loginStatus == 'true' ?
        "You have logged in!!!" :
         "You are not logged in!!!"
    }
    </h3>
}
